import React from 'react'
import "./lang-selector.css"

function LangSelector(props){
    return(
        <div className="dropdown">
            <select id="cars">
                <option value="en">English</option>
                <option value="he">Hebrew</option>
            </select>
        </div>
    )
}

export default LangSelector
